import React from 'react';
import defaultProfile from '../assets/defaultProfile.png';
import cartIcon from '../assets/icons8-shopping-cart-48.png';
import bookIcon from '../assets/icons8-book-50.png';
import searchIcon from '../assets/search.png';

const Navbar = ({ user = "Guest" }) => {
  return (
    <nav style={styles.navbar}>
      {/* Non-clickable 3rd & Chester with custom styling */}
      <div style={styles.homeButton}>
        <h3>3rd & Chester</h3>
      </div>

      <div style={styles.container}>
        {/* Search, Purchase History, and Cart buttons */}
        <div style={styles.navItems}>
          <div style={styles.navItem}>
            <button style={styles.navButton}>
              <span style={styles.navText}>Search</span>
              <img src={searchIcon} alt="Search" style={styles.navIcon} />
            </button>
          </div>

          <div style={styles.navItem}>
            <button style={styles.navButton}>
              <span style={styles.navText}>Purchase History</span>
              <img src={bookIcon} alt="Purchase History" style={styles.navIcon} />
            </button>
          </div>

          <div style={styles.navItem}>
            <button style={styles.navButton}>
              <span style={styles.navText}>View Cart</span>
              <img src={cartIcon} alt="Cart" style={styles.navIcon} />
            </button>
          </div>
        </div>

        {/* Profile and login information */}
        <div style={styles.profileContainer}>
          <div style={styles.nameContainer}>
            {user !== 'Guest' ? (
              <>
                <span style={styles.welcomeText}>Welcome,</span>
                <span style={styles.userName}>{user}</span>
              </>
            ) : (
              <>
                <span style={styles.welcomeText}>Click to</span>
                <span style={styles.userName}>Login</span>
              </>
            )}
          </div>
          <img 
            src={defaultProfile}
            alt="Profile" 
            style={styles.profileImage} 
          />
        </div>
      </div>
    </nav>
  );
};

const styles = {
  navbar: {
    backgroundColor: '#333',
    padding: '0',
    position: 'fixed',
    top: '0',
    left: '0',
    width: '100%',
    zIndex: '10000',
  },
  homeButton: {
    cursor: 'default', // Ensures it's not clickable
    fontSize: '24px',
    fontWeight: 'bold',
    color: '#fff',
    textAlign: 'center',
    padding: '10px 15px',
  },
  container: {
    display: 'flex',
    justifyContent: 'space-between',
    padding: '10px 20px',
    alignItems: 'center',
  },
  navItems: {
    display: 'flex',
    alignItems: 'center',
  },
  navItem: {
    marginRight: '30px',
  },
  navButton: {
    background: 'none',
    border: 'none',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    cursor: 'pointer',
    textDecoration: 'none',
  },
  navText: {
    color: '#fff',
    fontSize: '14px',
    fontWeight: 'bold',
    marginBottom: '5px',
  },
  navIcon: {
    width: '20px',
    height: '20px',
  },
  profileContainer: {
    display: 'flex',
    alignItems: 'center',
  },
  profileImage: {
    width: '60px',
    height: '60px',
    borderRadius: '50%',
    objectFit: 'cover',
    marginLeft: '10px',
  },
  nameContainer: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
  },
  welcomeText: {
    fontSize: '14px',
    fontWeight: 'normal',
    fontWeight: 'bold',
    color: '#fff',
  },
  userName: {
    fontSize: '16px',
    fontWeight: 'bold',
    color: '#fff',
  },
};

export default Navbar;
